import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";

function App() {
  return (
    <div className="App">
      <Container />
    </div>
  );
}
function Container() {
  return (
    <div className="container">
      <DevImg />
    </div>
  );
}

function DevImg() {
  return (
    <div className="image-wrapper">
      <img className="image" src="images/image.jpg" alt="Developer" />
    </div>
  );
}

function DevName() {}

function BIO() {}

function SkillsContainer() {}

function Skills() {}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
